import React, { Component } from 'react';
import Particles from 'react-particles-js';
import './App.css';
import Signin from './components/Signin/Signin';

const particlesOption={
  particles:{
    number:{
      value:30,
      density:{
        enable:true,
        value_area:800,
      }
    }
  }
}

class App extends Component {
  render(){
    return(
      <div className="App">
        <Particles 
              params={{
            		particles: {
            			line_linked: {
            				shadow: {
            					enable: true,
            					color: "#3CA9D1",
            					blur: 5
            				}
            			}
            		}
            	}} />
        <Signin />
      </div>
    )
  }
}

export default App;
